import React from 'react';
import './First.css';

function First() {
  return (
    <div className='first'>
      <h1>.......Studio PAYAL......</h1>
      <div className='first_container'>
        <p>
        PAYAL Studios is a Professional Photo Shoot Location at Sardulgarh, Rorki Chowk
        for Pre-Wedding, Post-Wedding, Catalog, Music Videos , Maternity & Much More.
        </p>
      </div>
    </div>
  );
}

export default First;
